import React, { useState, useEffect } from "react";
import Charts from "./Charts";
import Issues from "./Issues";

const Dashboard = () => {
  const [notebookOutputs, setNotebookOutputs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchNotebookOutputs = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch("http://127.0.0.1:5000/get-notebook-output");
      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }
      const data = await response.json();

      const parsedOutputs = data.outputs.map((output, index) => {
        const lines = output.split("\n");
        return {
          id: index + 1,
          timestamp: lines[0]?.replace("Timestamp: ", "").trim(),
          eventMessage: lines[1]?.replace("Event Message: ", "").trim(),
          podStatus: lines[2]?.replace("Pod Status: ", "").trim(),
          cpuUsage: lines[3]?.replace("CPU Usage: ", "").trim(),
          memoryUsage: lines[4]?.replace("Memory Usage: ", "").trim(),
          predictedIssue: lines[5]?.replace("Predicted Issue: ", "").trim(),
          confidence: lines[6]?.replace("Confidence (%): ", "").trim(),
        };
      });

      setNotebookOutputs(parsedOutputs);

      // Save anomalies to localStorage (you might want to handle this differently)
      const anomalies = parsedOutputs
        .filter((entry) => entry.podStatus === "Warning" || entry.predictedIssue !== "No issue detected")
        .map((entry) => ({
          id: entry.id,
          type: entry.predictedIssue,
          severity: entry.predictedIssue.includes("Anomaly") ? "Critical" : (entry.podStatus === "Warning" ? "High" : "Normal"),
          timestamp: entry.timestamp,
          cpuUsage: entry.cpuUsage,
          memoryUsage: entry.memoryUsage,
        }));

      localStorage.setItem("anomalies", JSON.stringify(anomalies));
    } catch (err) {
      console.error("Error fetching notebook output:", err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchNotebookOutputs();
    const interval = setInterval(fetchNotebookOutputs, 5000);
    return () => clearInterval(interval);
  }, []);

  if (loading) {
    return <div>⏳ Loading Data...</div>;
  }

  if (error) {
    return <div>🚨 Error loading data: {error}</div>;
  }

  return (
    <div className="dashboard">
      <h1>📊 Kubernetes Monitoring Dashboard</h1>
      <div className="stats">
        <p>Total Nodes: {notebookOutputs.length}</p>
        <p>Healthy Nodes: {notebookOutputs.filter(n => n.podStatus === "Normal" || n.podStatus === "Running").length}</p>
        <p>Issues Detected: {notebookOutputs.filter(n => n.podStatus === "Warning" || n.predictedIssue !== "No issue detected").length}</p>
        <p>Anomalies: {notebookOutputs.filter(n => n.predictedIssue.includes("Anomaly")).length}</p>
      </div>

      <h2>Recent Issues & Notebook Output</h2>
      <div className="table-container">
        <table className="recent-output-table">
          <thead>
            <tr>
              <th>Timestamp</th>
              <th>Event Message</th>
              <th>Pod Status</th>
              <th>CPU Usage</th>
              <th>Memory Usage</th>
              <th>Predicted Issue</th>
              <th>Confidence (%)</th>
            </tr>
          </thead>
          <tbody>
            {notebookOutputs.map((output) => (
              <tr key={output.id} className={output.podStatus === "Warning" || output.predictedIssue !== "No issue detected" ? "issue-row" : ""}>
                <td>{output.timestamp}</td>
                <td>{output.eventMessage}</td>
                <td>{output.podStatus}</td>
                <td>{output.cpuUsage}</td>
                <td>{output.memoryUsage}</td>
                <td>{output.predictedIssue}</td>
                <td>{output.confidence}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <h2>Issue Severity Breakdown</h2>
      <Charts chartData={notebookOutputs.map(output => ({
        time: output.timestamp,
        issues: output.podStatus === "Warning" || output.predictedIssue !== "No issue detected" ? 1 : 0,
      }))} />

      <Issues />
    </div>
  );
};

export default Dashboard;
